import React, { Component } from 'react';
import { Navbar,NavbarBrand,Button} from 'reactstrap';
import LeftComponent from './LeftComponent';
import { Network } from '../shared/providers';

class Menu extends Component {

    constructor(props) {
        super(props);
    
        this.state = {
          network:Network
        };
      }

    render() {
        return (
            <div>
                <Navbar dark color="primary">
                    <image href="/" width="30px" height="30px"/>
                    <NavbarBrand>ISP HackerEarth</NavbarBrand>
                    <p>- searching ISP made easy!</p>
                    <Button> Total ISP: {}   |  API Hits: {} </Button>
                </Navbar>
                
                <div className="col-12">
                
                    <LeftComponent network={this.state.network}/>
                       
                </div>
            </div>
        );
    }
}

export default Menu;
